import React from "react";

export default function EmptySpace() {
   return (
      <div className="emptySpace">
         <div class="search">
            <input
               type="text"
               class="searchTerm"
               placeholder="What are you looking for?"
            />
            <button type="submit" class="searchButton">
               <i class="fa fa-search"></i>
            </button>
         </div>
      </div>
   );
}
